import re

def extract_rgb_chars(ansi_str):
    pattern = r'\x1b\[38;2;(\d{1,3});(\d{1,3});(\d{1,3})m(.)\x1b\[0m'
    result = []

    for match in re.finditer(pattern, ansi_str):
        r, g, b, char = match.groups()
        r_hex = f"\\x{int(r):02x}"
        g_hex = f"\\x{int(g):02x}"
        b_hex = f"\\x{int(b):02x}"
        c_hex = f"\\x{ord(char):02x}"
        result.append(r_hex + g_hex + b_hex + c_hex)

    return ''.join(result)

